import adjustment from './adjustment.png';
import first from './set.png';
import another from './synck.png';
import white from './white.png';
import cloud from './cloud.png';
import smr from './smr.png';
import React from "react";
import equivalent from './equivalent.png';
import { Link } from 'react-router-dom';
import './DesktopScreenEPK.css';

class DesktopScreenEPK extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      hmm: ""
    };
  }

  componentDidMount() {
    console.log('sweet');
  }

  componentWillUnmount() {
    console.log('wow');
  }

  render() {
    return (
      <div className="Desktop-app">
        <Link className="Desktop-records" to="/">
          <img src={smr} className="Desktop-image" alt="smr" />
        </Link>
        <a href="https://www.instagram.com/ranesimons/">
          <img src={white} className="Desktop-insta" alt="logo" />
        </a>
        <div className="Desktop-top">
          <img src={adjustment} className="Desktop-profile" alt="profile"/>
            {/* <a href="https://www.instagram.com/ranesimons/">
                <img src={white} className="Small-insta" alt="logo" />
            </a> */}
            {/* <a href="https://soundcloud.com/theprinceofvenus">
                <img src={cloud} className="Small-cloud" alt="logo" />
            </a> */}
            {/* <Link className="Small-link" to="/">Records</Link> */}
            {/* <h1 className="Small-title">Rane Simons</h1> */}
          {/* <img src={profile} className="About-profile" alt="logo" /> */}
          {/* <div className="About-bio"></div> */}
          <img src={equivalent} className="Desktop-right" alt="logo" />
          {/* <div className="Desktop-intro">
            <img src={equivalent} className="Desktop-right" alt="logo" />
          </div> */}
        </div>
        <h1 className="Desktop-music">Music</h1>
        <div className="Desktop-row">
          <iframe className="Desktop-songs" title="It&#x27;s Never Goodbye - Remastered 2021" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/958257244&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
          <iframe className="Desktop-songs" title="Our Love Remains - Remastered 2021" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/958260820&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
        </div>
        <div className="Desktop-row">
          <iframe className="Desktop-songs" title="Set It Free" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/206362367&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
          <iframe className="Desktop-songs" title="Synchronicities - Remastered 2021" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/958262881&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
        </div>
        <div className="Desktop-row">
          <iframe className="Desktop-songs" title="The Golden Light - Remastered 2021" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/958261585&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
          <iframe className="Desktop-songs" title="Alright" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/1068004219&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
        </div>
        <div className="Desktop-row">
          <iframe className="Desktop-songs" title="You Gonna Roll The Weed?" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/1033494595&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
          <iframe className="Desktop-songs" title="There&#x27;s Another Way To Love" scrolling="no" frameBorder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/1000565353&show_playcount=false&color=%23080808&auto_play=false&hide_related=true&show_comments=true&show_user=false&show_reposts=false&show_teaser=false&visual=false"></iframe>
        </div>
        <div className="Desktop-words">
          <h1 className="Desktop-bio">Bio</h1>
          <p className="Desktop-words">&#9;Rane Simons is an indie singer-songwriter whose folk and blues inspired sound has been compared to James Taylor, George Harrison, and Jeff Buckley.&nbsp;
            Having grown up in Makanda, he got his first taste of performing for a festival during the spring of 2010 in what is now known as the Shawnee Cave Amphitheater.&nbsp;
            He went on to live in Champaign-Urbana playing various gigs for three years with the Illini Contraband before moving to Chicago.&nbsp;
            Traveling the summer of 2014 opened him to the thrill of street performing in Asheville, Portland, and Seattle.&nbsp;
            Back in Chicago, he returned to playing with a new band which culminated in a tour through Mississippi and New Orleans.&nbsp;
            After performing on Frenchmen street late into the night, he decided to focus on singing solo on Michigan Ave upon returning to Chicago.&nbsp;
            He has moved into recording and producing music with his entirely self-created EP Synchronicities and a new collaborations project called The Prince of Venus in his shared recording studio near Wrigley Field.
          </p>
        </div>
        <h1 className="Desktop-performances">Performances</h1>
        <div className="Desktop-box">
          <div className="Desktop-stack">
            <div className="Desktop-venue">Center Camp at Burning Man</div>
            <div className="Desktop-venue">Kingston Mines</div>
            <div className="Desktop-venue">Uncommon Ground</div>
            <div className="Desktop-venue">The Utah Inn</div>
            <div className="Desktop-venue">PUB OK</div>
            <div className="Desktop-venue">The Dock at Montrose Beach</div>
            <div className="Desktop-venue">The Emerald Palace</div>
            <div className="Desktop-venue">Hard Rock Cafe</div>
            <div className="Desktop-venue">Krannert Center for the Performing Arts</div>
            <div className="Desktop-venue">FIGMENT Chicago</div>
          </div>
          <div className="Desktop-stack">
            <div className="Desktop-venue">The Canopy Club</div>
            <div className="Desktop-venue">Allen Hall</div>
            <div className="Desktop-venue">Illini Union</div>
            <div className="Desktop-venue">Joe's Brewery</div>
            <div className="Desktop-venue">Red Herring Vegetarian Restaurant</div>
            <div className="Desktop-venue">Cowboy Monkey</div>
            <div className="Desktop-venue">Allen Hall</div>
            <div className="Desktop-venue">Illini Union</div>
            <div className="Desktop-venue">Joe's Brewery</div>
            <div className="Desktop-venue">PKs Bar</div>
            <div className="Desktop-venue">The Hangar 9</div>
          </div>
        </div>
        <h1 className="Desktop-contact">Contact</h1>
